const Options = () => {
    return (
        <div className="options">
            <div className="wrapper">
                <div className="optionsContainer">
                    <div className="paragraphs">
                        <p>Paragraphs :</p>
                        <input type="text" />
                    </div>
                    <div className="tags">
                        <p>Tags :</p>
                        <select></select>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Options;
